import { moduleMetadata } from '@storybook/angular';
import { ButtonComponent } from './button';
export default {
    title: 'Components/Button',
    component: ButtonComponent,
    decorators: [
        moduleMetadata({
            declarations: [ButtonComponent],
            imports: [],
        }),
    ],
    argTypes: {
        label: { control: 'text' },
    },
};
const Template = (args) => ({
    props: args,
});
export const Primary = Template.bind({});
